/*1.url:请求地址.可以不填,请求就不会发起,但如果不填又强行send,出了错不怪我
2.method: ‘GET'或'POST',全大写,默认GET
3.data: 要附带发送的数据,格式是一个object
4.async: 是否异步,默认true
5.type: 返回的数据类型,只有responseText或responseXML,默认responseText
6.complete: 请求完成时执行的函数
7.success: 请求成功时执行的函数
8.error: 请求失败时执行的函数
*/


/*var base = 'http://192.168.1.105:8080/RTC_Manage';*/
var base = 'http://192.168.1.107:8080/RTC_Manage';
var Loading = document.createElement('div');
		Loading.classList.add('loading');
		Loading.setAttribute('style','width: 100%;height: 100%;position: fixed;top: 0;left: 0;z-index: 100;background: rgba(0,0,0,0.5);');
		//toast.classList.add('tanchuang');
	Loading.innerHTML = `
	<img style="width: 100%; height: 100%;" src="data:image/gif;base64," alt="" />
	`;
var ajax = function () {
    var 
    xhr = function  () {
        return ('XMLHttpRequest' in window) ? function  () {
                return new XMLHttpRequest();
            } : function  () {
            return new ActiveXObject("Microsoft.XMLHTTP");
        }
    }(),
    formatData= function (fd) {
        var res = '';
        for(var f in fd) {
            res += f+'='+fd[f]+'&';
        }
        return res.slice(0,-1);
    },
    AJAX = function(ops) {
    	
        var root = this,
        req = xhr();
        root.url = base+ops.url;
        //console.log(root.url)
        root.type = ops.type || 'responseText';
        root.method = ops.method || 'GET';
        root.async = ops.async || true;     
        root.data = ops.data || {};
        root.complete = ops.complete || function  () {};
        root.success = ops.success || function(){};
        root.error =  ops.error || function (s) { 
        	console.log(root.url+'->status:'+s+'error!');
        	/*alert(root.url+'->status:'+s+'error!');*/
        	};
        root.abort = req.abort;
        root.setData = function  (data) {
            for(var d in data) {
                root.data[d] = data[d];
            }
        }
        document.body.appendChild(Loading);
        root.send = function  () {
            var datastring = formatData(root.data),
            sendstring,get = false,
            async = root.async,
            complete = root.complete,
            method = root.method,
            type=root.type;
            if(method === 'GET') {
                root.url+='?'+datastring;
                get = true;
            }
          
            req.open(method,root.url,async);
            if(!get) {
                req.setRequestHeader("Content-type","application/x-www-form-urlencoded");
                sendstring = datastring;
            }      

            //在send之前重置onreadystatechange方法,否则会出现新的同步请求会执行两次成功回调(chrome等在同步请求时也会执行onreadystatechange)
            req.onreadystatechange = async ? function  () {
                // console.log('async true');
                //console.log(req.readyState);
                if (req.readyState ==4){
                    complete();
                    $('.loading').remove();
                    //console.log(req.status);
                    if(req.status == 200) {
	                    	var data = req.responseText;
	                    	var res = eval("("+data+")");
	                  	if(res.status == 5000){
	                  		//console.log(res);
	                  		mui.toast('请先登录··');
	                  		location = 'login.html';
	                 	}else{
	                        	root.success(res);
	                  	}
                    } else {
                    	jzsb();
                        root.error(req.status);
                    }                   
                }
            } : null;
           
            req.send(sendstring);
            if(!async) {
                //console.log('async false');
                complete();
                $('.loading').remove();
                root.success(req[type]);
            }
        }
        root.url && root.send();        
    };
    return function(ops) {return new AJAX(ops);}    
}();

function jzsb(){
	//console.log('打开····');
		var toast = document.createElement('div');
		toast.setAttribute('style','width: 100%;height: 100%;position: fixed;top: 0;left: 0;z-index: 100;background: rgba(255,255,255,0.5);');
		//toast.classList.add('tanchuang');
	toast.innerHTML = `
	<img style="width: 100%; height: 100%;" src="data:image/png;base64,">
	`;
		document.body.appendChild(toast);
		
	}

